SET search_path TO ardor;

CREATE TABLE M_AIRLINE(
	ID SERIAL2 NOT NULL,
	CODE VARCHAR(2) NOT NULL,
	NAME VARCHAR(100) NOT NULL,
	DESCRIPTION VARCHAR(100),
	TKT_CODE VARCHAR(3),
	AIRLINE_URL VARCHAR(250),
	IS_LCC BIT DEFAULT '0' NOT NULL,
	IS_DOMESTIC BIT DEFAULT '0' NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MA_PK PRIMARY KEY (ID),
	CONSTRAINT MA_UN UNIQUE (CODE)
);

CREATE INDEX MA_CODE_IDX ON M_AIRLINE (CODE,TKT_CODE,IS_ACTIVE);


CREATE TABLE M_LOCATION(
	ID SERIAL2 NOT NULL,
	CODE VARCHAR(3) NOT NULL,
	NAME VARCHAR(100) NOT NULL,
	DESCRIPTION VARCHAR(100),
	CITY_CODE VARCHAR(3),
	CITY_NAME VARCHAR(100),
	STATE_CODE VARCHAR(3),
	STATE_NAME VARCHAR(100),
	COUNTRY_CODE VARCHAR(3),
	COUNTRY_NAME VARCHAR(100),
	ZONE_CODE VARCHAR(3),
	ZONE_NAME VARCHAR(100),
	LATITUDE VARCHAR(20),
	LONGITUDE VARCHAR(20),
	HAS_AIRPORT BIT DEFAULT '1' NOT NULL,
	HAS_CAR BIT DEFAULT '1' NOT NULL,
	HAS_HOTEL BIT DEFAULT '1' NOT NULL,
	ALTERNATE_CODES VARCHAR(500),
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT ML_PK PRIMARY KEY (ID),
	CONSTRAINT ML_UN UNIQUE (CODE)
);

CREATE INDEX ML_CODE_IDX ON M_LOCATION (CODE,CITY_CODE,STATE_CODE,COUNTRY_CODE,ZONE_CODE,IS_ACTIVE);

CREATE TABLE M_AIRLINE_CLASSES(
	ID SERIAL2 NOT NULL,
	AIRLINE_CODE VARCHAR(2) NOT NULL,
	CABIN_CODE VARCHAR(1) NOT NULL,
	CLASS VARCHAR(1) NOT NULL,
	IS_ACTIVE BIT DEFAULT '1' NOT NULL,
	CREATED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	MODIFIED TIMESTAMPTZ DEFAULT TRANSACTION_TIMESTAMP() NOT NULL,
	CONSTRAINT MAC_PK PRIMARY KEY (ID),
	CONSTRAINT MAC_UN UNIQUE (AIRLINE_CODE,CLASS),
	CONSTRAINT MAC_AC_FK FOREIGN KEY(AIRLINE_CODE) REFERENCES M_AIRLINE(CODE),
	CONSTRAINT AS_SC_FK FOREIGN KEY(CABIN_CODE) REFERENCES M_FLIGHT_CABIN(CODE)
);

CREATE INDEX MAC_CODE_IDX ON M_AIRLINE_CLASSES (AIRLINE_CODE,CABIN_CODE,CLASS,IS_ACTIVE);



